import './style.css';
import data from "../../data.json";
import photo from "../../assets/img/myphoto.png";

const a = data.map((data) => {
  return data.photo;
})

  function Title() {

    return (

      <div className="title-div">

        <div className="photo-div">
          <img src={photo}></img>
        </div>




      </div>

    )



  }


  export default Title;
